<!doctype html>
<html lang="id">

  <head>
    <meta charset="utf-8">
    <meta name="viewport" content="width=device-width, initial-scale=1">
	<link href="../asset/bootstrap-reboot.rtl.min.css" rel="stylesheet">

	<link rel="preconnect" href="https://fonts.googleapis.com">
	<link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
	<link href="https://fonts.googleapis.com/css2?family=Fredoka:wght@300..700&display=swap" rel="stylesheet">

	<style>
		html, body, main {
			width: 100%;
			min-height: 100vh;

			margin: 0;
			padding: 0;
			border: 0;
			outline: 0;

			background-color: #2e294e;
			color: white;
			font-family: fredoka;
		}

		main {
			display: flex;
			align-items: center;
			justify-content: center;
		}

		#prompt, #message-container {
			padding: 2rem;
			background-color: #d90368;
			border: 5px dashed #820263;
			border-radius: 5px;
		}

		#prompt {
			display: flex;
			align-items: center;
			justify-content: center;
			flex-direction: column;
		}

		#prompt label {
			margin-bottom: 2rem;
		}

		#prompt input {
			border: 1px solid white;
			text-align: center;
		}

		#open-button {
			font-size: large;
			margin-top: 2rem;
			background-color: #2e294e;
			color: white;
		}

		#open-button:active {
			background-color: #4f4971;
		}

		#root:has(#message-container) {
			display: block;
		}

		#wrapper:has(#message-container) {
			display: flex;
			align-items: center;
			justify-content: center;
			flex-direction: column;

			padding: 10vh 0;
		}

		#message-container {
			width: 80%;
		}

		#message-container #decor-star {
			position: absolute;
			top: 5vh;
			right: 7%;

			width: 100px;
		}

		#message-container p, #message-container ul {
			font-size: x-large;
		}

		#message-container h1, #message-container li {
			font-weight: 600;
		}

		#message-container div + li {
			margin-top: 2rem;
		}

		#message-container ul img {
			margin: 1.5rem 0;
			width: 300px;
		}
	</style>

		rootContainer = document.getElementById('root');

		async function getCryptoKey(password) {
			const encoder = new TextEncoder();
			const keyMaterial = encoder.encode(password);

			return crypto.subtle.importKey(
				'raw',
				keyMaterial,
				{ name: 'PBKDF2' },
				false,
				['deriveKey']
			);
		}

		async function deriveKey(password) {
			keyMaterial = await getCryptoKey(password);
			encoder = new TextEncoder();

			return crypto.subtle.deriveKey(
				{
					name: 'PBKDF2',
					salt: encoder.encode('nyam'),
					iterations: 100000,
					hash: 'SHA-256'
				},
				keyMaterial,
				{ name: 'AES-CTR', length: 256 },
				false,
				['encrypt', 'decrypt']
			);
		}

		async function decryptMessage() {
			const passwordInput = document.getElementById('password');

			const key = await deriveKey(passwordInput.value.toUpperCase());
			const counter = new Uint8Array(
				"208,22,163,108,225,180,24,156,227,103,212,6,138,230,166,208".split(',')
			);

			const encryptedData = base64ToArrayBuffer(encryptedMsg);

			const decryptedData = await crypto.subtle.decrypt(
				{ name: 'AES-CTR', counter, length : 64},
				key,
				encryptedData
			);

			const decoder = new TextDecoder();
			const decryptedMsg = decoder.decode(decryptedData);

			if (decryptedMsg.trim().startsWith('<div id="wrapper">')) {
				rootContainer.innerHTML = decryptedMsg;
			}
			else {
				passwordInput.value = '';
			}
		}

		// These two are from stackoverflow (surprisingly difficult to find
		// a reliable way to convert binary ArrayBuffer)
		// https://stackoverflow.com/a/38858004
		function arrayBufferToBase64(buffer) {
			var binary = '';
			var bytes = new Uint8Array(buffer);
			var len = bytes.byteLength;

			for (var i = 0; i < len; i++) {
				binary += String.fromCharCode(bytes[i]);
			}

			return window.btoa(binary);
		}

		function base64ToArrayBuffer(base64) {
			var binary_string = window.atob(base64);
			var len = binary_string.length;
			var bytes = new Uint8Array(len);

			for (var i = 0; i < len; i++)        {
				bytes[i] = binary_string.charCodeAt(i);
			}

			return bytes.buffer;
		}

		const openButton = document.getElementById('open-button');
		const passwordInput = document.getElementById('password');

		openButton.onclick = decryptMessage;
		passwordInput.onkeypress = (e) => { if (e.keyCode == 13) openButton.click() };
